import logo from './logo.svg';
import {BrowserRouter as Router, Route, Switch} from 'react-router-dom'
import './App.css';
import Form from './components/form';

function App() {
  return (
<Router> 
  <Switch>
    <Route path='/' exact strict component={Form}></Route>

  </Switch>
</Router>
  );
}

export default App;
